import React from "react";
import './Page2.css';
import about from '../Images/about.png';
import AOS from 'aos';
import 'aos/dist/aos.css';

function Page2() {

  useEffect(() => {
    AOS.init({
      once: true,
    });
  }, []);

  return (
    <div className="Page2">
      <div>
        <h1 className="headpage2" data-aos="fade-right">Change the way you build websites Forever.</h1>
        <p data-aos="fade-right">In case you are starting a business or launching any product in the <br />
        market, Using the availbale pages you can quickly get started in a day <br />
        with your website. The desgin quality is polished very well, it looks very <br />
        professional.</p>
      </div>
      <div className="cal-container">
      <img 
          src={about} 
          alt="Image"
        />
      </div>
    </div>
  );
}

export default Page2;
